import React from "react";
import { Link } from 'react-router-dom';


export function Landlord() 
{
    return (
        <div>
        <h1>Landlord</h1>
        <Link to="/createLL">Create Landlord</Link>
        <Link to="/updateLL">Update Landlord</Link>
        </div>
    );
}
